import { createApp } from 'vue';
import App from './App.vue';
import '@/assets/style/main.scss';
import store from '@/store';
import router from '@/router.js';
import { createPinia } from 'pinia';

const app = createApp(App);
app.use(store);
app.use(router);
app.use(createPinia());
app.mount('#app');
